import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import eventImage from '../../images/event-image.jpg';
import './events.css';

const Events = () => {

    return ( 
        <div id="Events">
            <div className="header container-fluid">
                <div className="header-content row d-flex align-items-center text-center">
                    <p className="display-1" style={{padding: '20px'}}>Upcoming and Past <br />Events</p>
                </div>
            </div>
            <div className="events-body container">
                <Card>
                    <CardActionArea>
                        <CardMedia
                            className="media"
                            image={eventImage}
                            title="Event"
                        />
                        <CardContent>
                            <h4>Event 1</h4>
                            <p className="fs-5">
                                Colors bounced around in her head. They mixed and threaded themselves together. 
                                Even colors that had no business being together. They were all one, yet distinctly separate at the same time. 
                            </p>
                        </CardContent>
                    </CardActionArea>
                </Card>
            </div>
        </div>

    )
}

export default Events;
